import React from 'react';

import UserLeaveItem from './UserItem/UserLeaveItem';
import './UserList.css';

const userLeaveList = props => {
  console.log("user attendance list props", props.userAttendance);
  const userLeave = props.userLeave.map(attendance => {
    return (
      <UserLeaveItem
        key={attendance.date}
        userId={props.authUserId}
        status={attendance.status}
        description={attendance.description}
      />
    );
  });

  return <ul className="userLeaveList">{userLeave}</ul>;
};

export default userAttendanceList;
